import React from "react";
import {Title} from './title';
import {VantaggiNoleggio} from './vantaggi_noleggio';
import styled, { css } from 'styled-components';
const RedRectangleContainer = styled.div`
    position: relative;
    z-index: 1;
    margin-bottom: 160px;
    &>div{
        margin-bottom: 35px;
    }
    & div>div{
        font-style: normal;
        font-weight: 400;
        font-size: 30px;
        line-height: 34px;
    }
    & div>img{
        margin-right: 40px;
    }
    & div:nth-child(4){
        margin-left: 50px !important;
        margin-right: 200px !important;
    }
    & div:nth-child(5){
        margin-left: 150px !important;
        margin-right: 460px!important;
    }
`;
const RedRectangle = styled.div`
    position: absolute;
    top: 0;
    left: -306px;
    background: #8D120C;
    width: 1515px;
    height: 546px;
    z-index: 0;
`;
const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    @media only all and (max-width: 1440px) {
        max-width: 100%!important;
        flex: 0 0 100%!important;
    }
`;
const TitleRinoleggo = styled.div`
    margin-top: 60px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 900;
    font-size: 60px;
    letter-spacing: 0.05em;
    text-decoration-line: underline;
    text-transform: uppercase;
    color: #1D1D1B;
    position: relative;
    z-index: 1;
`;
const Logo = styled.img`
    position: absolute;
    right: -8%;
    top: -15%;
`;
const CarRi = styled.img`
    position: absolute;
    right: -20%;
    bottom: -30%;
`;
const BlueArrow = styled.img`
    position: absolute;
    left: -25%;
    bottom: 20%;
`;
const CreditCard = styled.img`
    position: absolute;
    right: -17%;
    bottom: 17%;
`;
const RedArrowContainer = styled.div`
    position: relative;
    height: 80px;
`;
const RedArrow = styled.button`
    position: absolute;
    top: 0;
    right: 0;
    height: 78px;
    width: 760px;
    background: #8D120C;
    border-radius: 38.5px;
    padding-top: 10px;
    padding-bottom: 10px;
    padding-left: 10px;
    padding-right: 10px;
`;
const BlackArrow = styled.img`
    width: 57px;
    height: 57px;
    background: #1D1D1B;
    border-radius: 40px;
    margin: 0 10px 10px 15px;
`;
const WhatsUp = styled.img`
    width: 60px;
    height: 60px;
    margin-right: 20px;
`;
const Mail = styled.img`
    width: 60px;
    height: 60px;
    margin-right: 10px;
`;
const Chiama = styled.div`
    font-weight: 700;
    font-size: 24px;
    text-transform: uppercase;
    line-height: 30px;
    color: #FFFFFF;
`;
function Ri_noleggio() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto">
        <RedRectangle>
        </RedRectangle>
        <RedRectangleContainer>
            <TitleRinoleggo className="text-center">RINOLEGGIO</TitleRinoleggo>
            <div className="row">
                <img src="/images/Thick_Arrow.svg"/>
                <div className="col-sm">Puoi avere una spesa inferiore approfittando delle offerte del Ri Noleggio</div>
            </div>
            <div className="row">
                <img src="/images/Thick_Arrow.svg"/>
                <div className="col-sm">Sono auto che godono degli stessi vantaggi del a noleggio normal</div>
            </div>
            <div className="row">
                <img src="/images/Thick_Arrow.svg"/>
                <div className="col-sm">La differenza sta nel fatto che il Ri Noleggio ti permette dì scegliere tra delle auto che hanno già percorso dei km. 10, 30, 50 mila, dipende da cosa si trova e da cosa scegli tu</div>
            </div>
            <div className="row">
                <img src="/images/Thick_Arrow.svg"/>
                <div className="col-sm">Serve velocità dì decisione, il risparmio può essere anche a tripla cifra al mese!</div>
            </div>
            <Logo src="./images/logo5.svg"></Logo>
            <CarRi src="./images/Car_ri.png"></CarRi>
            <BlueArrow src="./images/Blue_Arrow.png"></BlueArrow>
            <CreditCard src="./images/Credit_cart2.png"></CreditCard>
        </RedRectangleContainer>
        <RedArrowContainer>
                <RedArrow className="row">
                    <Chiama className="col-sm">Chiama o lascia i tuoi dati per conoscere tutte le offerte</Chiama>
                    <WhatsUp src="/images/whatsapp.svg"></WhatsUp>
                    <Mail src="images/mail.png"></Mail>
                    <BlackArrow src="/images/Arrow_bottom.svg"></BlackArrow>
                </RedArrow>
            </RedArrowContainer>
        </Container>
        <VantaggiNoleggio/>
        </>
    );
}
export {Ri_noleggio};
